import { useEffect, useState } from "react";

import userService from "./Appservices/App.service";

function App() {
  const [stages, setStages] = useState([]);
  useEffect(() => {
    async function fetchResults() {
      try {
        const response = await userService.getAll("events");

        if (response.data) {
          setStages(response.data.items);
          console.log(response.data.items);
        }
      } catch (e) {
        console.log(e);
      }
    }
    fetchResults();
  }, []);

  return stages.map((stage, i) => <div key={i}>{stage.title}</div>);
}

export default App;
